    false,nt"url": null,nt"notes": "NCEI Accession 0148021 includes physical
    and underway data collected aboard the ROGER REVELLE during cruise RR1510 in the
    Arafura Sea, Coral Sea and others from 2015-07-07 to 2015-08-02. These data include
    CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT
    (V). The instruments used to collect these data include ADCP and GPS. These data
    were collected by University of California - San Diego; Scripps Institution of Oceanography
    as part of Transit. The Lamont-Doherty Earth Observatory (LDEO) submitted these
    data to NCEI as part of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe
    ADCP data represent the raw and automated processed data set. Post processed quality
